import header from '../assets/graphics/graphics-header.svg';
import footer from '../assets/graphics/graphics-footer.svg';
import '../App.css';

function Menu()
{
    return (
        <div class="Menu">
            <img class="Header" src={header}></img>
            <img class="Footer" src={footer}></img>
        </div>

    )
}
export default Menu;
